import React from "react"
import emojipedia from "../emojipedia"

function NewEmoji(props){
return (
    <div className="term">
    <dt>
      <span className="emoji" role="img" aria-label="Tense Biceps">
      {props.emoji}
      </span>
<span>{props.name}</span>
    </dt>
    <dd>
    {props.para}
    </dd>
  </div>
)
}
function createEmoji(myemoji){
    return (
        <NewEmoji

        name={myemoji.name}
        emoji={myemoji.emoji}
        meanin

/>
      
    )
}
